  render() { 
    return (
      <Router >
      <div> <Navbar />
    <Slider />
    <section>
    <div class="container">
        <div class="row">


    <Switch>
    <Route exact path="/">
            <Home />
          </Route>
          <Route exact path="/Sinscrire">
            <Sinscrire />
          </Route>
          <Route exact path="/Reparation">
            <Reparation />
          </Route>
          <Route exact path="/Intervention">
            <Intervention />
          </Route>
          <Route exact path="/SeConnecter">
            <SeConnecter />
          </Route>
          <Route path="/Panier">
            <Panier />
          </Route>
          <Route path="*">
            <Home />
          </Route>
        </Switch>

   </div>
   </div>
   </section>
   <Footer />
         </div>

         </Router> );
  }
}

export default App;
